import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
	<React.StrictMode>
		<div className="title"><h1>To-Do</h1></div>
		<App />
		<DrawBtn />
	</React.StrictMode>
);
